    private void parepareCategory() {
        long count = categoryService.countCategoryTable();
        if (count == 0) {
            try {

                /*Adding Category*/

                categoryService.createCategory(Category.builder().name(CategoryNames.SMARTPHONE.getName()).build());
                categoryService.createCategory(Category.builder().name(CategoryNames.TABLET.getName()).build());
                categoryService.createCategory(Category.builder().name(CategoryNames.LAPTOP.getName()).build());
                categoryService.createCategory(Category.builder().name(CategoryNames.ACCESSORY.getName()).build());
                categoryService.createCategory(Category.builder().name(CategoryNames.SPARES.getName()).build());
            } catch (Exception e) {
                e.printStackTrace();
            }
        }
    }

